import React from 'react';
import styles from './Footer.module.scss';
import Layout from '../../layout/Layout/Layout';
const Footer = () =>{
    return(
        <div className={styles.container}>
            <Layout>
                <ul>
                    <li>Ứng dụng kết nối thông minh G-STORE</li>
                </ul>
                <ul></ul>
            </Layout>
        </div>
    )
}

export default Footer;
